import React from "react";
import Square from "../AreaButton";
import map from "../../images/hyrulemap.png";
import "./style.css"

function Map() {
    return (
        <div id="map-container">
            <img id="map" src={map} alt="Hyrule Map"/>
            <div id="marker-container">
                <Square top="20px" left="20px"/>
                <Square top="40px" left="40px"/>
                <Square top="60px" left="60px"/>
                <Square top="80px" left="80px"/>
                <Square top="100px" left="20px"/>
                <Square top="20px" left="20px"/>
            </div>
        </div>
    )
}

export default Map;
